import "./App.css";
import { BrowserRouter } from "react-router-dom";
import { Service } from "./components";
import mem1 from './';
function App() {
  return (
  <div className="App">
    <BrowserRouter>
      <Service />
    </BrowserRouter>

    return (
        <div>
            <img src={mem1} alt="mem" />
        </div>
    );
  </div>
  );
}

export default App;
